
from functools import reduce

class ProductOfNumbers:
	def __init__(self):
		self.lst = []
		self.prod = {}
		self.zeroIdx = -1

	def add(self, num: int) -> None:
		if num == 0:
			self.zeroIdx = len(self.lst)
		self.lst.append(num)
		self.prod = {k + 1: v * num for k, v in self.prod.items()}

	def getProduct(self, k: int) -> int:
		if len(self.lst) - k <= self.zeroIdx:
			return 0
		if k not in self.prod:
			self.prod[k] = reduce(lambda x, y: x * y, self.lst[-k :])
		return self.prod[k]

